  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset includes requests for inspections
  not associated with issuance of a permit, beginning in November 1997 and ending
  in March 2005, from the Safety and Permits Information Network (SPIN). Inspection
  requests include complaints about violations of City code reported to Safety and
  Permits (e.g. building, zoning, and health codes) as well as non-complaint-related
  inspection requests for new business applications, alcoholic beverage outlets (ABO),
  zoning verifications, subdivisions, and address changes.\",\n\t\"license_title\":
